import './category.scss';

const CollectionPage = ({ items }) => (
    <div className="collection-page">
        <h2 className="title">{title.toUpperCase()}</h2>
        <div className="items">
            {
                items.map((item) => (
                    <CollectionItem className="collection-item"
                        key={item.id}
                        item={item} />
                ))
            }
        </div>
    </div>
)

export default CollectionPage;
